// Firestore App !!!
import './Print.css';

import ReturnAvataR from './Avatar';
import ReturnSceAu from './Sceau';
import ReturnSign from './Sign';

import ReturnSignTitle from './SignTitle';
import ReturnIdenity from './Identity';
import ReturnName from './Name';
import ReturnSexe from './Sexe';
import ReturnDate from './Date';
import ReturnList from './List';
import ReturnQrCode from './QrCode';

import ReactToPrint from 'react-to-print';

// Print component 
export default function ReturnPrint() {



 <ReactToPrint

  trigger={() => { return <button>print carte</button> }}

  content={() => this.componentRef}
  documentTitle='new Document'
  pageStyle='print'


 />


 return (
  <div className='wrp-print'>




   <div className='box-wrp-print' ref={el => { this.componentRef = el }}>

    <ReturnAvataR />
    <ReturnSceAu />
    <ReturnSign />
    <ReturnSignTitle />
    <ReturnIdenity />
    <ReturnName />
    <ReturnSexe />
    <ReturnDate />
    <ReturnList />
    <ReturnQrCode />

   </div>





  </div>
 )
};
